def get_google_creds():
    creds = None
    env_token = os.getenv("GDRIVE_TOKEN")
    if env_token:
        token_data = json.loads(env_token)
        creds = Credentials.from_authorized_user_info(token_data, SCOPES)
    elif os.path.exists('token.json'):
        creds = Credentials.from_authorized_user_file('token.json', SCOPES)
    if creds and creds.expired and creds.refresh_token:
        creds.refresh(Request())
    if not creds:
        flow = InstalledAppFlow.from_client_secrets_file('credentials.json', SCOPES)
        creds = flow.run_local_server(port=0)
        with open('token.json', 'w') as token:
            token.write(creds.to_json())
    return creds

def fetch_pubmed_data():
    print(" Querying PubMed...")
    Entrez.email = EMAIL
    date_tag = (datetime.datetime.now() - datetime.timedelta(days=7)).strftime("%Y/%m/%d")
    query = f"{SEARCH_TERM_PUBMED} {date_tag}[pdat]"
    try:
        handle = Entrez.esearch(db="pubmed", term=query, retmax=40)
        record = Entrez.read(handle)
        ids = record["IdList"]
        if not ids: return []
        handle = Entrez.efetch(db="pubmed", id=",".join(ids), rettype="abstract", retmode="xml")
        papers = Entrez.read(handle)
        results = []
        for article in papers['PubmedArticle']:
            citation = article['MedlineCitation']
            pmid = str(citation['PMID'])
            article_data = citation['Article']
            author_list = article_data.get('AuthorList', [])
            names = [f"{a.get('LastName', '')} {a.get('Initials', '')}".strip() for a in author_list]
            full_authors = ", ".join(names) if names else "Unknown"
            results.append({
                "title": article_data.get('ArticleTitle', 'No Title'),
                "journal": article_data['Journal'].get('Title', 'Unknown Journal'),
                "authors": full_authors,
                "link": f"https://pubmed.ncbi.nlm.nih.gov/{pmid}/",
                "abstract": " ".join(article_data.get('Abstract', {}).get('AbstractText', ["No abstract"]))
            })
        return results
    except Exception as e:
        print(f"PubMed Error: {e}"); return []

def fetch_biorxiv_data():
    print(" Querying bioRxiv...")
    today = datetime.date.today()
    start_date = (today - datetime.timedelta(days=2)).strftime("%Y-%m-%d")
    url = f"https://api.biorxiv.org/details/biorxiv/{start_date}/{today.strftime('%Y-%m-%d')}/0/json"
    try:
        response = requests.get(url, timeout=30)
        data = response.json()
        if 'collection' not in data: return []
        results = []
        keywords = ["mtdna", "mitochondrial dna"]
        for entry in data['collection']:
            text = (entry['title'] + entry['abstract']).lower()
            if any(k in text for k in keywords):
                results.append({
                    "title": entry['title'],
                    "journal": "bioRxiv (Preprint)",
                    "authors": entry['authors'],
                    "link": f"https://doi.org/{entry['doi']}",
                    "abstract": entry['abstract']
                })
        return results
    except: return []

def fetch_data():
    return fetch_pubmed_data() + fetch_biorxiv_data()

